INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 1, 1, 102601, 24001, 0, "2030/12/17 14:59:59", 10040, "あたしだって\nやるときはやるよ！", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 1, 1, 102601, 24002, 1, "2030/12/17 14:59:59", 10040, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 1, 1, 102601, 24003, 2, "2030/12/17 14:59:59", 10040, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 2, 2, 102601, 24004, 3, "2030/12/17 14:59:59", 10040, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 1, 1, 102601, 24005, 4, "2030/12/17 14:59:59", 10040, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 2, 2, 102601, 24006, 5, "2030/12/17 14:59:59", 10040, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 2, 2, 102601, 24007, 6, "2030/12/17 14:59:59", 10040, "あたしも意外と\nやるもんでしょ？", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 4, 4, 102601, 24008, 7, "2030/12/17 14:59:59", 10040, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 4, 4, 102601, 24009, 8, "2030/12/17 14:59:59", 10040, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 4, 4, 102601, 24010, 9, "2030/12/17 14:59:59", 10040, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 4, 4, 102601, 24011, 10, "2030/12/17 14:59:59", 10040, "やられた…\nねずみって意外と\nてごわいね", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 4, 4, 102601, 24012, 11, "2030/12/17 14:59:59", 10040, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("リン", 24, "2020/04/30 12:00:00", 4, 1, 102601, 24013, 12, "2030/12/17 14:59:59", 10040, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 0.0, 1.81);
